INSERT INTO destination VALUES (1,'Garuda Wisnu Kencana Cultural Park',1,0,0,0,0,'https://res.klook.com/image/upload/c_fill,w_843,h_474/q_80/w_80,x_15,y_15,g_south_west,l_Klook_water_br_trans_yhcmh3/activities/oq25lomlxr0havtllzdj.webp','Badung Regency','A popular tourist attraction located in the southern part of Bali, Indonesia. It is often referred to as GWK for short. The park is situated on a hilltop in the village of Ungasan and offers breathtaking views of the surrounding area','09.00 - 21.00','09.00 - 21.00',-8.8104228,115.1675986,40000,375000,0,1216,934,3493,10550,38173,54366,4.5,'https://www.google.com/maps/place/Garuda+Wisnu+Kencana+Cultural+Park/@-8.8104228,115.16759859999999,14z/data=!4m8!1m2!2m1!1sGaruda+Wisnu+Kencana+Cultural+Park!3m4!1s0x2dd244cf54e1dec7:0x1988663e064f5a51!8m2!3d-8.8104228!4d115.16759859999999'),
	(2,'Pandawa Beach',1,0,1,0,0,'https://www.jonnymelon.com/wp-content/uploads/2021/07/pandawa-beach-10-1440x959.jpg','Badung Regency','Pandawa Beach is known for its pristine white sand, turquoise waters, and towering limestone cliffs, making it a picturesque and scenic spot.','08.00 - 18.00','08.00 - 18.00',-8.8454504,115.1866116,4000,15000,1,618,473,2444,8080,28222,39837,4.6,'https://www.google.com/maps/place/Pandawa+Beach/@-8.845450399999999,115.18661159999999,14z/data=!4m8!1m2!2m1!1sPandawa+Beach!3m4!1s0x2dd25b04f214986d:0x7277dbadb45a6499!8m2!3d-8.845450399999999!4d115.18661159999999'),
	(3,'Beachwalk Shopping Center',0,0,1,0,0,'https://asset.kompas.com/crops/vdy3bJFvkYtgXzMtZ7S5HEHJ3Bc=/0x43:886x486/750x500/data/photo/2020/11/05/5fa3e21e6997b.png','Badung Regency','Beachwalk Shopping Center offers a mix of international and local brands, providing a wide range of shopping options for visitors. ','10.00 - 22.00','10.00 - 23.00',-8.7169483,115.168807,0,0,1,508,410,2741,9504,25870,39033,4.5,'https://www.google.com/maps/place/Beachwalk+Shopping+Center/@-8.7169483,115.168807,14z/data=!4m8!1m2!2m1!1sBeachwalk+Shopping+Center!3m4!1s0x2dd246bee02094a9:0x2545b9cc094b5de6!8m2!3d-8.7169483!4d115.168807'),
	(4,'Pura Tirta Empul',1,1,1,0,0,'https://www.nativeindonesia.com/foto/tirta-empul/tirta-empul-tampaksiring-768x576.jpg','Gianyar Regency','The name "Tirta Empul" translates to "holy water spring" in Balinese, which is fitting considering the temple''s main attraction—the natural spring that flows within its complex','08.00 - 18.00','08.00 - 18.00',-8.4156589,115.3153284,15000,50000,1,184,185,894,3468,13573,18304,4.6,'https://www.google.com/maps/place/Pura+Tirta+Empul/@-8.4156589,115.3153284,14z/data=!4m8!1m2!2m1!1sPura+Tirta+Empul!3m4!1s0x2dd218f4e06131b5:0x53a25a017714ecc1!8m2!3d-8.4156589!4d115.3153284'),
	(5,'Dimsum jayatir',0,0,0,1,0,'https://img.qraved.co/v2/image/data/untitled-1-1531988520865-l.png','Denpasar City','Dimsum Jayatir is one of most favourite dimsum resto in Bali','10.06 - 16.06','Closed',-8.6565343,115.2124193,0,0,1,387,263,1275,3281,11123,16329,4.5,'https://www.google.com/maps/place/Dimsum+jayatir/@-8.656534299999999,115.2124193,14z/data=!4m8!1m2!2m1!1sDimsum+jayatir!3m4!1s0x2dd240a20b08cb11:0xc0600ec21e227e5e!8m2!3d-8.656534299999999!4d115.2124193'),
	(6,'Melasti Beach Ungasan',1,1,1,0,0,'https://lh5.googleusercontent.com/p/AF1QipOr2a9bHzJBSXl2GsIL7Nz8fZaZ2zZiDPLOQ3Qe=w114-h114-n-k-no','Badung Regency','Melasti Beach presents a combination of the natural beauty of the beach and culture that can be enjoyed in only one destination, Charming Beach Destinations with Twin Cliffs (The Twin Hills),','00.00 - 24.00','00.00 - 24.00',-8.8477419,115.1606704,3000,8000,1,116,64,297,1763,12240,14480,4.8,'https://www.google.com/maps/place/Melasti+Beach+Ungasan/@-8.847741899999999,115.1606704,14z/data=!4m8!1m2!2m1!1sMelasti+Beach+Ungasan!3m4!1s0x2dd25b937f74a77f:0xd7fc41e66544fbab!8m2!3d-8.847741899999999!4d115.1606704'),
	(7,'Kuta Beach',0,1,1,0,1,'https://i2.wp.com/blog.tripcetera.com/id/wp-content/uploads/2020/03/leebudihart_76864081_2484833498431751_3194446755026370817_n-1080x508.jpg','Badung Regency','Kuta Beach is known for its beautiful sandy shores, vibrant atmosphere, and excellent surfing conditions','00.00 - 24.00','00.00 - 24.00',-8.7127552,115.1668777,0,0,1,252,189,969,2647,9941,13998,4.6,'https://www.google.com/maps/place/Kuta+Beach/@-8.7127552,115.1668777,14z/data=!4m8!1m2!2m1!1sKuta+Beach!3m4!1s0x2dd24781456bb291:0x7174dc29ec5b0282!8m2!3d-8.7127552!4d115.1668777'),
	(8,'Bajra Sandhi Monument',1,1,0,0,0,'data:image/jpeg;base64,','Denpasar City','The Bajra Sandhi Monument, also known as Monumen Perjuangan Rakyat Bali (Monument of Balinese People''s Struggle), is a prominent landmark and cultural symbol located in Denpasar, the capital city of Bali, Indonesia. The monument stands as a tribute to the struggles and resilience of the Balinese people throughout history.','08.00 - 18.00','08.00 - 18.00',-8.6717348,115.233902,2000,25000,1,212,102,764,2799,9374,13251,4.6,'https://www.google.com/maps/place/Bajra+Sandhi+Monument/@-8.6717348,115.233902,14z/data=!4m8!1m2!2m1!1sBajra+Sandhi+Monument!3m4!1s0x2dd240f5b0baad2f:0xf67150ab4e009a2c!8m2!3d-8.6717348!4d115.233902'),
	(9,'Waterbom Bali',0,1,0,0,0,'https://dynamic-media-cdn.tripadvisor.com/media/photo-o/0f/53/5e/42/photo0jpg.jpg?w=700&h=300&s=1','Badung Regency','Waterbom Bali is a renowned water park located in Kuta, Bali, Indonesia. It is widely recognized as one of the best water parks in Asia and has received numerous awards for its attractions, facilities, and commitment to safety','09.00 - 18.00','09.00 - 18.00',-8.7285829,115.16929,251000,1521000,1,167,107,398,1830,8955,11457,4.7,'https://www.google.com/maps/place/Waterbom+Bali/@-8.7285829,115.16928999999999,14z/data=!4m8!1m2!2m1!1sWaterbom+Bali!3m4!1s0x2dd246a3ee8f82df:0x1291d693f3407fa5!8m2!3d-8.7285829!4d115.16928999999999'),
	(10,'Bali Bird Park',0,1,0,0,0,'https://s-light.tiket.photos/t/01E25EBZS3W0FY9GTG6C42E1SE/rsfit19201280gsm/events/2021/11/22/3f4762d4-5134-46e4-b6ec-e01b84ff6557-1637583910097-5c2fb416491b413a479000497ebc73b8.jpg','Gianyar Regency','The Bali Bird Park is a popular avian-themed attraction located in Gianyar, Bali, Indonesia. It is home to a vast collection of exotic and rare bird species from Indonesia and other parts of the world, making it a paradise for bird enthusiasts and nature lovers.','09.00 - 17.30','09:00 - 17:30',-8.5998549,115.2523191,70000,192500,1,218,159,591,2066,7412,10446,4.6,'https://www.google.com/maps/place/Bali+Bird+Park/@-8.5998549,115.2523191,14z/data=!4m8!1m2!2m1!1sBali+Bird+Park!3m4!1s0x2dd23e4efac54c0f:0x5f8920acf656382c!8m2!3d-8.5998549!4d115.2523191'),
	(11,'Lumintang Park',1,1,0,0,0,'https://dynamic-media-cdn.tripadvisor.com/media/photo-o/0b/30/db/ba/img-20160508-183331-largejpg.jpg?w=900&h=600&s=1','Denpasar City','Lumintang City Park is commonly used to exercise, play, and relax. There''s a bench under shady tree in every corner of the park.','00.00 - 24.00','00.00 - 24.00',-8.6359218,115.2129875,0,0,1,293,150,781,1995,6503,9722,4.5,'https://www.google.com/maps/place/Lumintang+Park/@-8.6359218,115.2129875,14z/data=!4m8!1m2!2m1!1sLumintang+Park!3m4!1s0x2dd23f69e6da0fcb:0xf642bf47db9fd60b!8m2!3d-8.6359218!4d115.2129875'),
	(12,'Waterblow',0,1,1,0,0,'https://www.rentalmobilbali.net/wp-content/uploads/2014/11/Water-Blow-Nusa-Dua.jpg','Badung Regency','The Waterblow is a natural phenomenon and popular tourist attraction located in Nusa Dua, Bali, Indonesia. It is a unique coastal feature where the waves from the Indian Ocean crash against the cliffs, resulting in a spectacular display of water spray and foam.','09.00 - 18.00','09.00 - 18.00',-8.8038567,115.2398639,10000,25000,1,191,189,884,2145,5419,8828,4.4,'https://www.google.com/maps/place/Waterblow/@-8.803856699999999,115.23986389999999,14z/data=!4m8!1m2!2m1!1sWaterblow!3m4!1s0x2dd242d64fdf1499:0x693ff9065fcd1f44!8m2!3d-8.803856699999999!4d115.23986389999999'),
	(13,'Werdhi Budaya Art Centre',1,1,0,0,0,'https://akcdn.detik.net.id/community/media/visual/2022/06/15/penampilan-sanggar-keong-sari-dari-banjar-batur-desa-batu-bulan-sukawati-duta-kabupaten-gianyar-dalam-lomba-barong-ket-di-pkb-_169.jpeg?w=700&q=90','Denpasar City','The Werdhi Budaya Art Centre is spread across a vast area and comprises multiple buildings and outdoor spaces dedicated to different art forms and performances. The complex is designed in a traditional Balinese architectural style, reflecting the island''s cultural identity.','07.30 - 15.30','Closed',-8.6556215,115.2338714,0,0,1,197,91,498,1536,6169,8491,4.6,'https://www.google.com/maps/place/Werdhi+Budaya+Art+Centre/@-8.655621499999999,115.2338714,14z/data=!4m8!1m2!2m1!1sWerdhi+Budaya+Art+Centre!3m4!1s0x2dd2408774ac0e19:0xee8eace99d65c91e!8m2!3d-8.655621499999999!4d115.2338714'),
	(14,'Tugu Peringatan Bom Bali',1,1,0,0,0,'https://www.rentalmobilbali.net/wp-content/uploads/2014/01/Monumen-Ground-Zero-Bali.jpg','Badung Regency','The Tugu Peringatan Bom Bali is a solemn and reflective place that honors the victims and serves as a reminder of the impact of the terrorist attack. The monument consists of a large stone slab inscribed with the names of those who lost their lives in the bombings. The names are engraved in gold and arranged according to nationality.','00.00 - 24.00','00.00 - 24.00',-8.7173941,115.1744685,0,0,1,100,78,521,1461,5129,7289,4.6,'https://www.google.com/maps/place/Tugu+Peringatan+Bom+Bali/@-8.7173941,115.17446849999999,14z/data=!4m8!1m2!2m1!1sTugu+Peringatan+Bom+Bali!3m4!1s0x2dd246b9a26f15bb:0xc500c6afd79e4c1b!8m2!3d-8.7173941!4d115.17446849999999'),
	(15,'Patung Garuda Wisnu Kencana',1,1,0,0,1,'https://asset.kompas.com/crops/fhyXeS2borIrSmZbPebufHwNVdQ=/12x8:993x662/750x500/data/photo/2018/09/27/1679906755.jpg','Badung Regency','The GWK Statue is a testament to Balinese artistry and craftsmanship. It stands at a towering height of approximately 121 meters (397 feet), including its pedestal, making it one of the tallest statues in the world. The statue itself measures around 75 meters (246 feet) in height.','09.30 - 18.00','09.30 - 18.00',-8.8141136,115.166614,80000,115000,1,157,129,406,1261,4932,6885,4.6,'https://www.google.com/maps/place/Patung+Garuda+Wisnu+Kencana/@-8.814113599999999,115.166614,14z/data=!4m8!1m2!2m1!1sPatung+Garuda+Wisnu+Kencana!3m4!1s0x2dd244b5401fddef:0xfaf0a4cd8d840fd7!8m2!3d-8.814113599999999!4d115.166614'),
	(16,'Lapangan Niti Mandala Renon - Monumen Perjuangan Rakyat Bali',1,1,0,0,0,'https://getlost.id/wp-content/uploads/2021/07/bajra-sandhi_1844514466-696x464.jpg','Denpasar City','Lapangan Niti Mandala Renon, also known as Renon Square, is a significant public square located in Denpasar, the capital city of Bali, Indonesia. It is a central gathering place for various civic and cultural events and is home to the Monumen Perjuangan Rakyat Bali, or the Bali People''s Struggle Monument.','00.00 - 24.00','00.00 - 24.00',-8.6722175,115.2327023,0,0,1,118,59,231,1049,4556,6013,4.6,'https://www.google.com/maps/place/Lapangan+Niti+Mandala+Renon+-+Monumen+Perjuangan+Rakyat+Bali/@-8.6722175,115.2327023,14z/data=!4m8!1m2!2m1!1sLapangan+Niti+Mandala+Renon+-+Monumen+Perjuangan+Rakyat+Bali!3m4!1s0x2dd240f44fe23ac1:0x42e00aff575fe573!8m2!3d-8.6722175!4d115.2327023'),
	(17,'Sangeh Monkey Forest',0,1,1,0,0,'https://a.cdn-hotels.com/gdcs/production21/d1538/40d24d9f-8a9f-4812-9275-2bc2fa3b8611.jpg?impolicy=fcrop&w=800&h=533&q=medium','Badung Regency','The Sangeh Monkey Forest is a lush sanctuary located in the village of Sangeh, near Mengwi in Bali, Indonesia. It is known for its population of long-tailed macaque monkeys and its serene natural surroundings, making it a popular attraction for nature lovers and wildlife enthusiasts.','08.00 - 17.00','08.00 - 17.00',-8.4817743,115.2067391,5000,30000,1,93,92,401,1204,3979,5769,4.5,'https://www.google.com/maps/place/Sangeh+Monkey+Forest/@-8.4817743,115.2067391,14z/data=!4m8!1m2!2m1!1sSangeh+Monkey+Forest!3m4!1s0x2dd223492c21e6a3:0xb715386c995db0c2!8m2!3d-8.4817743!4d115.2067391'),
	(18,'Big Garden Corner',1,1,0,0,0,'https://dynamic-media-cdn.tripadvisor.com/media/photo-o/0f/56/5a/f8/wonderful-photo-opportunities.jpg?w=700&h=0&s=1','Denpasar City','Big Garden Corner, a tourist park located in the corner of Denpasar city on the edge of the main highway by pass Ngurah Rai Padang Galak Sanur, to be exact west of the Padang Galak intersection – Jalan Waribang, East Denpasar, located about 850 meters south of the Titi Banda statue.','09.00 - 18.00','09.00 - 18.00',-8.6567502,115.2533172,30000,75000,1,192,149,600,1413,3311,5665,4.3,'https://www.google.com/maps/place/Big+Garden+Corner/@-8.6567502,115.2533172,14z/data=!4m8!1m2!2m1!1sBig+Garden+Corner!3m4!1s0x2dd24071d99200c3:0x6b8b5fe4aa9162c0!8m2!3d-8.6567502!4d115.2533172'),
	(19,'Atlas Beach Fest',0,1,0,1,1,'https://awsimages.detik.net.id/visual/2022/07/22/atlas-beach-fest_169.jpeg?w=715&q=90','Badung Regency','Atlas Beach Fest is a new beach club in Bali which has been opened in the area of ​​Berawa, Canggu, North Kuta, Badung. This beach club was originally called Holywings with Hotman Paris and Nikita Mirzani as shareholders.','10.00 - 23.59','10.00 - 23.59',-8.6651578,115.1396438,145000,23437500,1,223,40,109,335,4396,5103,4.7,'https://www.google.com/maps/place/Atlas+Beach+Fest/@-8.6651578,115.1396438,14z/data=!4m8!1m2!2m1!1sAtlas+Beach+Fest!3m4!1s0x2dd247a4d9049d09:0x414f42d9423b8d36!8m2!3d-8.6651578!4d115.1396438'),
	(20,'Penangkaran Penyu Bali Tanjung Benoa',0,1,1,0,0,'https://ik.imagekit.io/tvlk/xpe-asset/AyJ40ZAo1DOyPyKLZ9c3RGQHTP2oT4ZXW+QmPVVkFQiXFSv42UaHGzSmaSzQ8DO5QIbWPZuF+VkYVRk6gh-Vg4ECbfuQRQ4pHjWJ5Rmbtkk=/3771044243285/TURTLE-ISLAND-%25281-BOAT-1-HOUR-8-PAX%2529-a2bd799c-394b-4b6c-b5c5-93c4aa91489e.jpeg?_src=imagekit&tr=c-at_max,h-400,q-60,w-1280','Badung Regency','Penangkaran Penyu Bali Tanjung Benoa, also known as the Bali Turtle Conservation and Education Center, is a turtle conservation facility located in the Tanjung Benoa area of Bali, Indonesia. It is dedicated to the preservation and protection of sea turtles, as well as raising awareness about their importance in marine ecosystems.','09.00 - 17.00','09.00 - 17.00',-8.7617034,115.2161812,10000,20000,1,357,169,670,1128,2455,4779,4.1,'https://www.google.com/maps/place/Penangkaran+Penyu+Bali+Tanjung+Benoa/@-8.7617034,115.2161812,14z/data=!4m8!1m2!2m1!1sPenangkaran+Penyu+Bali+Tanjung+Benoa!3m4!1s0x2dd243a32e668d47:0x3d52bd86b73ff3de!8m2!3d-8.7617034!4d115.2161812'),
	(21,'Water Sport Adventure Bali Dolphin Shop',0,1,1,0,0,'https://www.seeingbali.com/images/gallery/tours/seeingbali-fly-fish-tanjung-benoa-with-dolphin-water-sports-75.jpg','Badung Regency','Water Sports Adventure Bali Dolphin Shop is a provider of various water rides with beautiful beach views located in Nusa Dua Bali','07.30 - 17.00','07.30 - 17.00',-8.7530772,115.2202874,619743,1161513,0,306,192,532,951,2049,4030,4.1,'https://www.google.com/maps/place/Water+Sport+Adventure+Bali+Dolphin+Shop/@-8.7530772,115.22028739999999,14z/data=!4m8!1m2!2m1!1sWater+Sport+Adventure+Bali+Dolphin+Shop!3m4!1s0x2dd243b8e6c58b87:0xe958bb6d54a9d706!8m2!3d-8.7530772!4d115.22028739999999'),
	(22,'Satria Gatotkaca Park',1,1,0,0,0,'https://dynamic-media-cdn.tripadvisor.com/media/photo-o/10/e0/58/39/satria-gatotkaca.jpg?w=700&h=300&s=1','Badung Regency','Satria Gatotkaca Park, also known as Satria Agung Park, is a cultural park located in the Gianyar regency of Bali, Indonesia. The park is dedicated to showcasing and preserving Indonesian mythology, particularly the story of Gatotkaca, a heroic character from the ancient Javanese epic, the Mahabharata.','00.00 - 24.00','00.00 - 24.00',-8.7443882,115.1788673,0,0,1,69,37,212,724,2821,3863,4.6,'https://www.google.com/maps/place/Satria+Gatotkaca+Park/@-8.7443882,115.1788673,14z/data=!4m8!1m2!2m1!1sSatria+Gatotkaca+Park!3m4!1s0x2dd2440f8fee4add:0xc8da53e970262159!8m2!3d-8.7443882!4d115.1788673'),
	(23,'Upside Down World Bali',1,1,0,0,0,'https://dynamic-media-cdn.tripadvisor.com/media/photo-o/0a/8b/e3/b1/try-cooking-upside-down.jpg?w=700&h=300&s=1','Denpasar City','Upside Down World Bali is a unique tourist attraction located in Bali, Indonesia. As the name suggests, it offers a fun and unconventional experience where everything inside the facility is upside down, creating a visually captivating environment.','09.00 - 20.30','09.00 - 20.30',-8.716711,115.2052612,50000,100000,1,138,124,452,883,2021,3618,4.3,'https://www.google.com/maps/place/Upside+Down+World+Bali/@-8.716711,115.2052612,14z/data=!4m8!1m2!2m1!1sUpside+Down+World+Bali!3m4!1s0x2dd2414421ee552f:0xb23009c36c511835!8m2!3d-8.716711!4d115.2052612'),
	(24,'Trans Studio Bali',0,1,0,1,1,'https://asset.kompas.com/crops/B7Xe5hH_q_HaOgBnpIcvTNQrDcM=/178x36:979x570/750x500/data/photo/2022/12/29/63adb778622c3.jpg','Denpasar City','Trans Studio Bali offers a wide range of entertainment options and attractions suitable for visitors of all ages. The park features various themed zones, each offering unique experiences and activities. These zones often include thrilling rides, interactive games, live performances, and immersive attractions.','10.30 - 19.00','10.30 - 19.00',-8.7025328,115.1847671,175000,1000000,1,58,44,202,719,2559,3582,4.6,'https://www.google.com/maps/place/Trans+Studio+Bali/@-8.7025328,115.18476709999999,14z/data=!4m8!1m2!2m1!1sTrans+Studio+Bali!3m4!1s0x2dd247bda5e920ab:0x1358b74608482a20!8m2!3d-8.7025328!4d115.18476709999999'),
	(25,'Art Market Kumbasari',1,0,0,0,1,'https://a.cdn-hotels.com/gdcs/production23/d1343/b0ae51ff-4f16-45a0-a8df-6080ec2919c1.jpg?impolicy=fcrop&w=800&h=533&q=medium','Denpasar City','Art Market Kumbasari, also known as Pasar Seni Kumbasari, is a bustling traditional market located in the heart of Denpasar, the capital city of Bali, Indonesia. It is a popular destination for locals and tourists alike, offering a wide range of arts, crafts, textiles, and souvenirs.','09.00 - 17.00','09.00 - 17.00',-8.6558956,115.2117719,0,5000,1,69,74,405,808,1921,3277,4.4,'https://www.google.com/maps/place/Art+Market+Kumbasari/@-8.6558956,115.21177189999999,14z/data=!4m8!1m2!2m1!1sArt+Market+Kumbasari!3m4!1s0x2dd240a21b176fe7:0x4f357bbf942163e3!8m2!3d-8.6558956!4d115.21177189999999'),
