	(29,'Puja Mandala',1,0,0,0,0,'https://asset.kompas.com/crops/fWjK0ZwmM_zrnbWbmSKC6Py1Kio=/0x0:1277x851/750x500/data/photo/2021/04/28/6088d8332347d.jpg','Badung Regency','uja Mandala is a unique religious complex located in Nusa Dua, Bali, Indonesia. It is a place of worship that showcases the harmonious coexistence of different religions in Bali, emphasizing religious tolerance and unity.','08.00 - 16.00','08.00 - 12.00',-8.800614,115.214104,0,0,0,34,18,121,456,2266,2895,4.7,'https://www.google.com/maps/place/Puja+Mandala/@-8.800614,115.21410399999999,14z/data=!4m8!1m2!2m1!1sPuja+Mandala!3m4!1s0x2dd243386a82c3fd:0xff15dab4ad5b7a51!8m2!3d-8.800614!4d115.21410399999999'),
	(30,'Masjid Agung Ibnu Batutah',1,0,0,0,0,'https://upload.wikimedia.org/wikipedia/commons/thumb/c/c5/Kuta_Bali_Indonesia_Masjid-Agung-Ibnu-Batutah-02.jpg/800px-Kuta_Bali_Indonesia_Masjid-Agung-Ibnu-Batutah-02.jpg','Badung Regency','Masjid Agung Ibnu Batutah, also known as the Great Mosque of Ibnu Batutah, is a significant mosque located in Jalan Sudirman, Denpasar, Bali, Indonesia. It is named after the renowned Muslim scholar and traveler, Ibn Battuta.','00.00 - 24.00','00.00 - 24.00',-8.8005156,115.2134044,0,0,1,26,9,58,260,2351,2704,4.8,'https://www.google.com/maps/place/Masjid+Agung+Ibnu+Batutah/@-8.800515599999999,115.2134044,14z/data=!4m8!1m2!2m1!1sMasjid+Agung+Ibnu+Batutah!3m4!1s0x2dd2441fb5e464a9:0x4898fbc8ffcf2fb4!8m2!3d-8.800515599999999!4d115.2134044'),
	(31,'Sindhu Market',0,0,0,1,1,'https://www.denpasarkota.go.id/public/uploads/bisnis/bisnis_202904080453_TetapBelanjadiPasarSinduSanur,AdaPilihanOnline.jpg','Denpasar City','Pasar Sindu is a traditional market located in Sanur, a popular coastal town in Bali, Indonesia. It is known for its lively atmosphere, diverse selection of goods, and its appeal to both locals and tourists.','04.00 - 23.00','04.00 - 23.00',-8.685235,115.2599958,0,0,1,49,63,281,650,1644,2687,4.4,'https://www.google.com/maps/place/Pasar+Sindu/@-8.685235,115.2599958,14z/data=!4m8!1m2!2m1!1sPasar+Sindu!3m4!1s0x504431901a68655:0x3c03f9153fbf1028!8m2!3d-8.685235!4d115.2599958'),
	(32,'Masjid Al-Ihsan - Sanur',1,0,0,0,0,'https://cloud.jpnn.com/photo/bali/news/normal/2022/06/24/masjid-al-ihsan-sanur-denpasar-menjadi-rujukan-turis-domesti-pcqa.jpg','Denpasar City','Masjid Al-Ihsan is characterized by its beautiful architectural design, combining traditional Indonesian elements with Islamic influences. The mosque features a spacious prayer hall, a dome, and minarets, creating a distinctive visual appeal.','00.00 - 24.00','00.00 - 24.00',-8.6751422,115.2606639,0,0,0,21,6,40,232,2317,2616,4.8,'https://www.google.com/maps/place/Masjid+Al-Ihsan+-+Sanur/@-8.6751422,115.2606639,14z/data=!4m8!1m2!2m1!1sMasjid+Al-Ihsan+-+Sanur!3m4!1s0x2dd2403886b0cdbf:0x989d64546dc6f609!8m2!3d-8.6751422!4d115.2606639'),
	(33,'Hidden Canyon Beji Guwang',0,1,1,0,0,'https://res.klook.com/image/upload/c_fill,w_843,h_474/q_80/w_80,x_15,y_15,g_south_west,l_Klook_water_br_trans_yhcmh3/activities/ud2una0klynvud0laehx.webp','Gianyar Regency','Hidden Canyon Beji Guwang is characterized by its beautiful rock formations, towering cliffs, and narrow canyons. It is formed by the erosion of the river over centuries, creating a mesmerizing landscape of rocks and water. The canyons are carved into the earth, resulting in a series of stunning natural passages.','08.30 - 16.30','08.30 - 16.30',-8.6099153,115.2894286,180000,240000,1,116,46,138,378,1803,2481,4.5,'https://www.google.com/maps/place/Hidden+Canyon+Beji+Guwang/@-8.609915299999999,115.2894286,14z/data=!4m8!1m2!2m1!1sHidden+Canyon+Beji+Guwang!3m4!1s0x2dd2157e9462182d:0x6e3602576c543e7b!8m2!3d-8.609915299999999!4d115.2894286'),
	(34,'Bali Museum',1,1,0,0,0,'https://a.cdn-hotels.com/gdcs/production168/d1493/a5dbdb0a-5df6-4aef-9d28-98884634ae84.jpg?impolicy=fcrop&w=800&h=533&q=medium','Denpasar City','The museum is housed in a traditional Balinese-style building that reflects the local architectural style and aesthetics. It is divided into several pavilions, each dedicated to different aspects of Balinese culture and history. The exhibits cover a wide range of topics, including traditional arts and crafts, religious artifacts, historical artifacts, archaeological finds, and ethnographic displays.','07.30 - 15.30','07.30 - 15.30',-8.6575741,115.2185908,25000,50000,1,68,57,246,523,1453,2347,4.4,'https://www.google.com/maps/place/Bali+Museum/@-8.6575741,115.2185908,14z/data=!4m8!1m2!2m1!1sBali+Museum!3m4!1s0x2dd2409a2f3cad43:0xf32d693f7bfe87da!8m2!3d-8.6575741!4d115.2185908'),
	(35,'Tanjung Benoa Beach',0,1,1,0,0,'https://lh5.googleusercontent.com/p/AF1QipOVgSc9M4wZArLMP7klT7xp7qZsHLPDX91mFT5M=w260-h175-n-k-no','Badung Regency','Tanjung Benoa Beach offers a more relaxed and tranquil atmosphere compared to some of the busier beaches in Bali, making it a preferred destination for travelers seeking a peaceful beach experience. The beach is lined with resorts, hotels, and restaurants, providing visitors with comfortable accommodation and dining options.','00.00 - 24.00','00.00 - 24.00',-8.7562017,115.2216644,70000,350000,1,48,38,173,564,1488,2311,4.5,'https://www.google.com/maps/place/Tanjung+Benoa+Beach/@-8.7562017,115.2216644,14z/data=!4m8!1m2!2m1!1sTanjung+Benoa+Beach!3m4!1s0x2dd243baf5ddb4a7:0x3617f534f05b65b9!8m2!3d-8.7562017!4d115.2216644'),
