	(37,'Pantai Matahari Terbit Sanur',0,1,1,0,0,'https://www.befreetour.com/laravel-filemanager/photos/Artikel%20Review/Bali/Pantai%20Matahari%20Terbit/Menyusuri_pantai_tanpa_bibir_pantai_yang_menakjubkan.jpg','Denpasar City','Matahari Terbit Beach is a great spot to witness the sunrise, as the name suggests. Early morning is the best time to visit when the sky starts to brighten, and you can witness the stunning colors of the sunrise over the ocean. It''s a peaceful and serene experience that many visitors find captivating.','00.00 - 24.00','00.00 - 24.00',-8.6706845,115.2616902,0,0,1,36,15,82,345,1452,1930,4.6,'https://www.google.com/maps/place/Pantai+Matahari+Terbit+Sanur/@-8.6706845,115.26169019999999,14z/data=!4m8!1m2!2m1!1sPantai+Matahari+Terbit+Sanur!3m4!1s0x2dd24130040b91fb:0xc14d9277f1634539!8m2!3d-8.6706845!4d115.26169019999999'),
	(38,'Satya Dharma Temple',1,0,0,0,0,'https://dynamic-media-cdn.tripadvisor.com/media/photo-o/08/c8/b1/a8/satya-dharma-shrine-temple.jpg?w=700&h=300&s=1','Denpasar City','At Satya Dharma Temple, visitors can experience the unique rituals and customs associated with Balinese Hinduism. The temple hosts regular ceremonies and religious festivals, providing an opportunity to witness traditional dance performances, music, and spiritual offerings.','07.00 - 17.00','07.00 - 17.00',-8.7210265,115.2144481,0,0,1,10,11,49,245,1566,1881,4.8,'https://www.google.com/maps/place/Satya+Dharma+Temple/@-8.721026499999999,115.2144481,14z/data=!4m8!1m2!2m1!1sSatya+Dharma+Temple!3m4!1s0x2dd24167df343ed5:0x5715a849e31af7f8!8m2!3d-8.721026499999999!4d115.2144481'),
