	(40,'Bali Wake Park',0,1,0,0,0,'https://asset.kompas.com/crops/-QEVYJWXcuF_G484ZiCjTa4xuak=/3x0:915x608/750x500/data/photo/2022/01/25/61efff4647785.jpg','Denpasar City','Bali Wake Park is a popular water sports and recreational facility located in Benoa, Bali, Indonesia. It is a cable park that offers wakeboarding and other water-based activities in a controlled environment, making it suitable for both beginners and experienced riders.','10.00 - 18.00','10.00 - 18.00',-8.7240482,115.2144449,220000,20000000,1,77,36,110,330,1141,1694,4.4,'https://www.google.com/maps/place/Bali+Wake+Park/@-8.7240482,115.21444489999999,14z/data=!4m8!1m2!2m1!1sBali+Wake+Park!3m4!1s0x2dd2416717d0a1ab:0xdd299a8a093a881b!8m2!3d-8.7240482!4d115.21444489999999'),
	(41,'Bali National Golf Club',0,1,1,0,0,'https://www.befreetour.com/img/produk/bali-national-golf-club/bali-national-golf-club_278d22e7ec22d68eb2be67f61c9da4d8046cf463.png','Badung Regency','Bali National Golf Club is a prestigious golf course located in Nusa Dua, Bali, Indonesia. It is renowned as one of the top golfing destinations in Asia and offers a world-class golfing experience amidst stunning natural surroundings.','06.00 - 19.00','06.00 - 19.00',-8.8104049,115.2247164,7095320,12750000,1,45,17,71,277,1269,1679,4.6,'https://www.google.com/maps/place/Bali+National+Golf+Club/@-8.8104049,115.22471639999999,14z/data=!4m8!1m2!2m1!1sBali+National+Golf+Club!3m4!1s0x2dd2432632a7e491:0x191db66fc1832044!8m2!3d-8.8104049!4d115.22471639999999'),
	(42,'Barong Tanah Kilap - Sari Wisata Budaya BALI',1,1,0,0,0,'https://pr0.nicelocal.id/XyE02TDcuytgU9_r9ZN6zQ/2400x1350,q75/4px-BW84_n0QJGVPszge3NRBsKw-2VcOifrJIjPYFYkOtaCZxxXQ2dszQXfqI3iTzF7s9gTz8J3KPrggQqGDPyf9SZRgKqJbQtZmc-mD819uxIb6oYc2mA','Denpasar City','Sari Wisata Budaya group is one of the Balinese traditional dances group in Denpasar holds regular Barong and Kecak Dance Show.','09.00 - 10.30','09.00 - 10.30',-8.7188326,115.1924588,100000,150000,1,40,49,141,389,1057,1676,4.4,'https://www.google.com/maps/place/Barong+Tanah+Kilap+-+Sari+Wisata+Budaya+BALI/@-8.718832599999999,115.1924588,14z/data=!4m8!1m2!2m1!1sBarong+Tanah+Kilap+-+Sari+Wisata+Budaya+BALI!3m4!1s0x2dd2414c5b2eae35:0x345684bb5f52fa7a!8m2!3d-8.718832599999999!4d115.1924588'),
	(43,'Nurul Huda Mosque',1,0,0,0,0,'https://media.suara.com/pictures/653x366/2023/04/02/22549-masjid-nurul-huda.webp','Badung Regency','The mosque features traditional Islamic architectural elements and design, with a distinctive dome and minaret. It provides a serene and peaceful environment for prayer and reflection. The mosque is open to Muslims and visitors who wish to learn about Islamic culture and observe the prayer rituals.','00.00 - 24.00','00.00 - 24.00',-8.7440658,115.178042,0,0,0,16,6,30,138,1447,1637,4.8,'https://www.google.com/maps/place/Nurul+Huda+Mosque+%E1%AC%A6%E1%AC%B9%E1%AC%AD%E1%AC%B8%E1%AC%AE%E1%AD%84%E1%AC%B3%E1%AC%B8%E1%AC%A4+%E1%AC%AB%E1%AD%80%E1%AC%B2%E1%AD%84%E1%AC%93%E1%AD%84%E1%AD%9F/@-8.7440658,115.17804199999999,14z/data=!4m8!1m2!2m1!1sNurul+Huda+Mosque+%E1%AC%A6%E1%AC%B9%E1%AC%AD%E1%AC%B8%E1%AC%AE%E1%AD%84%E1%AC%B3%E1%AC%B8%E1%AC%A4+%E1%AC%AB%E1%AD%80%E1%AC%B2%E1%AD%84%E1%AC%93%E1%AD%84%E1%AD%9F!3m4!1s0x2dd245b9d72f7c2d:0xed947edbc000906b!8m2!3d-8.7440658!4d115.17804199999999'),
	(44,'Balangan Beach',0,1,1,0,0,'https://img.trvcdn.net/https://bb.trvcdn.net/uploads/galleries/140965381057465fc266478_Balangan-Beach-Bali.jpg?imgeng=m_box/w_1418/h_946','Badung Regency','Balangan Beach is a white sandy beach stretch 200 meters with panoramic view to the Indian Ocean and blessed by the spectacular sunset that create the romantic nuance for every visitor who visiting this beach. This beach is also endowed by enormous wave that is demanded by all surfers in particular for experience up to professional surfers.','00.00 - 24.00','00.00 - 24.00',-8.7910968,115.1243377,5000,10000,1,29,13,115,366,1099,1622,4.5,'https://www.google.com/maps/place/Balangan+Beach/@-8.7910968,115.1243377,14z/data=!4m8!1m2!2m1!1sBalangan+Beach!3m4!1s0x2dd2458cd2f032fd:0x6d1803dc2417aa2a!8m2!3d-8.7910968!4d115.1243377'),
	(45,'Taman Festival Bali, Padang Galak',1,1,1,0,0,'https://www.denpasarkota.go.id/public/uploads/wisata/Cerita-dan-Misteri-Tentang-Taman-Festival-Padang-Galak_220825.jpg','Denpasar City','Taman Festival Bali, also known as the Bali Ghost Town, is an abandoned amusement park located in the Padang Galak area of Bali, Indonesia. It was once intended to be a cultural theme park showcasing the history and traditions of Bali, but it was never completed and eventually fell into disrepair.','00.00 - 24.00','00.00 - 24.00',-8.6575124,115.2654034,10000,10000,1,64,41,138,285,931,1459,4.4,'https://www.google.com/maps/place/Taman+Festival+Bali%2C+Padang+Galak/@-8.6575124,115.2654034,14z/data=!4m8!1m2!2m1!1sTaman+Festival+Bali%2C+Padang+Galak!3m4!1s0x2dd240121a35ea2f:0xc9d9ad54dfef06e4!8m2!3d-8.6575124!4d115.2654034'),
