	(49,'Karma Beach',0,1,1,1,0,'https://a.cdn-hotels.com/gdcs/production67/d1211/5b94da29-92bb-4be6-939e-baea1fe700bf.jpg?impolicy=fcrop&w=800&h=533&q=medium','Badung Regency','Karma Beach, also known as Karma Kandara Beach, is a beautiful and secluded beach located on the Bukit Peninsula in southern Bali, Indonesia. It is part of the Karma Kandara Resort, which is known for its luxury accommodations and stunning cliffside location.','09.00 - 21.00','09.00 - 21.00',-8.8476219,115.1528783,250000,650000,1,39,25,59,181,948,1252,4.6,'https://www.google.com/maps/place/Karma+Beach/@-8.8476219,115.1528783,14z/data=!4m8!1m2!2m1!1sKarma+Beach!3m4!1s0x2dd25b92c5bff49d:0xe6fc4bf128853913!8m2!3d-8.8476219!4d115.1528783'),
