	(59,'Vihara Dharmayana Kuta',1,0,0,0,0,'https://www.viharadharmayana.org/wp-content/uploads/2022/01/viharakuta-2-1.jpeg','Badung Regency','Vihara Dharmayana Kuta is known for its intricate ornamentation, vibrant colors, and ornate carvings. The temple complex includes multiple buildings and pavilions, each serving a specific purpose. These include the main shrine, prayer halls, meditation rooms, and a library.','09.00 - 20.00','09.00 - 20.00',-8.7238605,115.1778992,0,0,1,7,2,21,86,637,753,4.8,'https://www.google.com/maps/place/Vihara+Dharmayana+Kuta/@-8.723860499999999,115.1778992,14z/data=!4m8!1m2!2m1!1sVihara+Dharmayana+Kuta!3m4!1s0x2dd246c36e20fd5b:0xd9038f91dd8aa0fc!8m2!3d-8.723860499999999!4d115.1778992'),
