	(61,'Pura Geger Beach',0,1,1,0,0,'https://cdn.idntimes.com/content-images/community/2022/06/ezgif-5-4225db4fe7-d7a5cfe6be371380223a4ffc73ad4e08-bf9f9bd9848b35c8f0916c7ed19720d7.jpg','Badung Regency','Pura Geger Beach is known for its soft white sand, clear turquoise waters, and stunning coastal scenery. The beach offers a tranquil and relaxed atmosphere, making it a popular spot for sunbathing, swimming, and enjoying the natural beauty of Bali.','00.00 - 24.00','00.00 - 24.00',-8.81998,115.2243173,5000,5000,1,9,4,22,84,500,619,4.7,'https://www.google.com/maps/place/Pura+Geger+Beach/@-8.81998,115.2243173,14z/data=!4m8!1m2!2m1!1sPura+Geger+Beach!3m4!1s0x2dd25ccfdf2bbe1f:0x27ad3d7e47072359!8m2!3d-8.81998!4d115.2243173'),
