	(63,'Peninsula Island',1,1,1,0,0,'https://images.bisnis.com/posts/2018/02/20/757435/nusa-dua2-1.jpg','Badung Regency','Peninsula Island is a small island located in the ITDC area side by side with the island of Nusa Dharma, the two islands are the forerunners of the name Nusa Dua','06.00 - 22.00','06.00 - 22.00',-8.802634,115.238981,0,0,1,8,2,32,121,394,557,4.6,'https://www.google.com/maps/place/Peninsula+Island/@-8.802634,115.238981,14z/data=!4m8!1m2!2m1!1sPeninsula+Island!3m4!1s0x2dd242d7ab709d33:0x39de1606c19ad392!8m2!3d-8.802634!4d115.238981'),
	(64,'Museum Le Mayeur',1,1,0,0,0,'https://www.balitoursclub.net/wp-content/uploads/2016/12/Monumen-Le-Mayeur-dan-Ni-Pollok.jpg','Denpasar City','The museum is housed in the former residence of Le Mayeur, which he lived in from the 1930s until his death in 1958. Le Mayeur was captivated by the beauty of Bali and its people, and his paintings often depicted scenes of Balinese daily life, landscapes, and portraits. The museum displays a collection of his artworks, providing visitors with a glimpse into his artistic journey and his love for Bali.','08.00 - 15.30','08.00 - 15.30',-8.6748773,115.2636777,2000,50000,1,22,19,69,134,290,534,4.2,'https://www.google.com/maps/place/Museum+Le+Mayeur/@-8.6748773,115.26367769999999,14z/data=!4m8!1m2!2m1!1sMuseum+Le+Mayeur!3m4!1s0x2dd24039af93edab:0xbc2308b38e03f5c2!8m2!3d-8.6748773!4d115.26367769999999'),
