	(66,'Sakenan Temple',1,0,0,0,0,'https://a.cdn-hotels.com/gdcs/production136/d157/dab16fe0-47f2-4d6f-a88b-f6edd5ae8eac.jpg?impolicy=fcrop&w=800&h=533&q=medium','Denpasar City','Sakenan Temple, also known as Pura Sakenan, is a significant Hindu temple located on the island of Serangan, just off the coast of Bali, Indonesia. The temple holds cultural and religious importance for the local community and attracts visitors seeking to explore Bali''s spiritual heritage.','07.00 - 17.00','07.00 - 17.00',-8.7252486,115.229424,0,0,1,7,8,20,66,415,516,4.7,'https://www.google.com/maps/place/Sakenan+Temple/@-8.7252486,115.229424,14z/data=!4m8!1m2!2m1!1sSakenan+Temple!3m4!1s0x2dd23f2329ebb933:0x5ab8bcd6bc17f621!8m2!3d-8.7252486!4d115.229424'),
