	(69,'Pandora Experience Escape Room Bali',1,1,0,0,0,'https://media-cdn.tripadvisor.com/media/attractions-splice-spp-720x480/0a/f3/63/86.jpg','Badung Regency','Pandora Experience Escape Room Bali is an interactive entertainment venue located in Bali, Indonesia. It offers immersive escape room experiences where participants are tasked with solving puzzles, finding clues, and working together as a team to escape from a themed room within a given time limit.','11.00 - 19.00','07.00 - 20.00',-8.7065454,115.1780584,230000,290000,1,15,3,14,52,351,435,4.7,'https://www.google.com/maps/place/Pandora+Experience+Escape+Room+Bali/@-8.7065454,115.1780584,14z/data=!4m8!1m2!2m1!1sPandora+Experience+Escape+Room+Bali!3m4!1s0x2dd246cf7ab2527b:0xe0db0a862b86eea8!8m2!3d-8.7065454!4d115.1780584'),
	(70,'Museum Pasifika Bali',1,1,0,0,0,'https://www.rentalmobilbali.net/wp-content/uploads/2014/02/Museum-Pasifika-Nusa-Dua.jpg','Badung Regency','Museum Pasifika is an art museum located in Nusa Dua, Bali, Indonesia. It is dedicated to showcasing and preserving the rich artistic heritage of the Asia-Pacific region, particularly focusing on traditional and contemporary art from Bali, Indonesia, and other Pacific nations.','10.00 - 18.00','10.00 - 18.00',-8.8001117,115.2307077,70000,100000,1,6,8,41,97,276,428,4.5,'https://www.google.com/maps/place/Museum+Pasifika+Bali/@-8.8001117,115.2307077,14z/data=!4m8!1m2!2m1!1sMuseum+Pasifika+Bali!3m4!1s0x2dd241bee15fb345:0x36c6dce41ae717e7!8m2!3d-8.8001117!4d115.2307077'),
	(71,'Sanur Beach Bali',0,1,1,0,0,'https://cove-blog-id.sgp1.cdn.digitaloceanspaces.com/cove-blog-id/2022/10/pantai-sanur.webp','Denpasar City','Sanur Beach is a popular tourist destination located on the southeastern coast of Bali, Indonesia. Known for its laid-back atmosphere and calm waters, Sanur Beach attracts visitors seeking relaxation, water activities, and a quieter beach experience compared to some of the more bustling beaches in Bali.','00.00 - 24.00','00.00 - 24.00',-8.6972632,115.266197,0,0,1,3,4,24,62,319,412,4.7,'https://www.google.com/maps/place/Sanur+Beach+Bali/@-8.6972632,115.26619699999999,14z/data=!4m8!1m2!2m1!1sSanur+Beach+Bali!3m4!1s0x2dd241d8e18b1c93:0xebaefe300cdb6d43!8m2!3d-8.6972632!4d115.26619699999999'),
	(72,'Splash Water Park Bali',0,1,0,1,0,'https://www.pinhome.id/info-area/wp-content/uploads/2022/04/panorama-splash-waterpark-bali.jpg','Badung Regency','Splash Water Park Bali is a popular water park located in Canggu, Bali, Indonesia. It offers a wide range of water attractions and activities for visitors of all ages, making it a fun-filled destination for families, friends, and water enthusiasts.','09.00 - 17.00','09.00 - 17.00',-8.6625577,115.147928,135000,200000,1,25,20,39,113,209,406,4.1,'https://www.google.com/maps/place/Splash+Water+Park+Bali/@-8.662557699999999,115.147928,14z/data=!4m8!1m2!2m1!1sSplash+Water+Park+Bali!3m4!1s0x2dd24779f0158265:0x5dc13a1cd94c2578!8m2!3d-8.662557699999999!4d115.147928'),
	(73,'Nirmala Waterpark',0,1,0,0,0,'https://travelspromo.com/wp-content/uploads/2019/05/Kolam-Seluncur-di-Nirmala-Waterpark-Ungasan-Bali-Nirmala-Supermarket-e1557284280900-640x400.jpg','Badung Regency','Nirmala waterpark is a family tourism destination waterpark that offers a variety of pools and rides in the shade of the park area.','08.00 - 17.30','08.00 - 17.30',-8.8158721,115.1546315,35000,50000,1,48,20,74,97,161,400,3.8,'https://www.google.com/maps/place/Nirmala+Waterpark/@-8.8158721,115.1546315,14z/data=!4m8!1m2!2m1!1sNirmala+Waterpark!3m4!1s0x2dd244cd48f8f0f9:0x37b3a166f2690063!8m2!3d-8.8158721!4d115.1546315'),
	(74,'Honeymoon Beach',0,1,1,0,0,'https://www.balitoursclub.net/wp-content/uploads/2017/09/Pantai-Honeymoon-Jimbaran.jpg','Badung Regency','Honeymoon Beach Jimbaran is one of the hidden beaches in the South Bali area, you will be treated to the natural beauty of the sea and rocky hills.','00.00 - 24.00','00.00 - 24.00',-8.7797921,115.1439473,0,0,1,15,6,25,74,275,395,4.5,'https://www.google.com/maps/place/Honeymoon+Beach/@-8.7797921,115.1439473,14z/data=!4m8!1m2!2m1!1sHoneymoon+Beach!3m4!1s0x2dd2458434c8f4e7:0xac40c46224f0a0cf!8m2!3d-8.7797921!4d115.1439473'),
