	(76,'Saint Joseph Catholic Church',1,0,0,0,0,'https://upload.wikimedia.org/wikipedia/commons/thumb/2/25/DenpasarSt.JosephChurch.JPG/220px-DenpasarSt.JosephChurch.JPG','Denpasar City','The Saint Joseph Catholic Church is known for its beautiful architecture and serene ambiance. The church provides a peaceful environment for prayer, worship, and religious ceremonies. It often hosts Mass services, sacraments such as baptisms and weddings, as well as other religious events and gatherings.','00.00 - 24.00','00.00 - 24.00',-8.6559219,115.2202432,0,0,1,4,3,18,43,310,378,4.7,'https://www.google.com/maps/place/Saint+Joseph+Catholic+Church/@-8.6559219,115.2202432,14z/data=!4m8!1m2!2m1!1sSaint+Joseph+Catholic+Church!3m4!1s0x2dd2409b8ccf66c5:0xd8c796f23b723a4!8m2!3d-8.6559219!4d115.2202432'),
	(77,'5GX Bali',0,1,0,0,0,'https://travelspromo.com/wp-content/uploads/2019/09/Reverse-Bungy.-Foto-Gmap-Arjun-Sarup-e1569213116862-640x400.jpg','Badung Regency','The 5GX Bali extreme reverse bungy game rides are open from 11 a.m. to 2 a.m. If you try the 5GX Bali ride in the afternoon, when you fly up to a height of 50 meters, you will be able to see a sunset view. If you try the Bali slingshot ride at night, then you will be able to see all the lights around Jalan Legian Kuta','11.00 - 02.00','11.00 - 02.00',-8.7178511,115.174477,300000,350000,1,5,4,13,53,290,365,4.7,'https://www.google.com/maps/place/5GX+Bali/@-8.717851099999999,115.174477,14z/data=!4m8!1m2!2m1!1s5GX+Bali!3m4!1s0x2dd246c6c2b664e3:0x87bf7e718fc653ec!8m2!3d-8.717851099999999!4d115.174477'),
	(78,'PELABUHAN MATAHARI TERBIT',0,1,1,0,0,'https://www.balipost.com/wp-content/uploads/2020/02/balipostcom_jasa-penyeberangan-di-pantai-sanur-belum-dikenakan-retribusi_01-696x464.jpg','Denpasar City','One of the famous and most beautiful harbors in Bali, Sanur Beach Harbor is known for its beautiful sunrises and views of the 2 iconic lighthouses','06.00 - 14.00','06.00 - 14.00',-8.6723839,115.2626988,200000,300000,1,12,11,45,88,204,360,4.3,'https://www.google.com/maps/place/PELABUHAN+MATAHARI+TERBIT/@-8.6723839,115.2626988,14z/data=!4m8!1m2!2m1!1sPELABUHAN+MATAHARI+TERBIT!3m4!1s0x2dd24110bc68a2f3:0x781a7d9acc3e9bd7!8m2!3d-8.6723839!4d115.2626988'),
	(79,'Mangrove Forest Suwung Kawuh',0,1,1,0,0,'https://www.denpasarkota.go.id/public/uploads/pojok/Berkunjung_Ke_Hutan_Mangrove__Salah_Satu_Cara_Segarkan_Mata_518962.jpg','Denpasar City','The Msngrove Forest tourist area is located on JL. By Pass Ngurah Rai Km. 21, Suwung Kauh, Pemogan, Kuta, Denpasar City, Bali. This mangrove forest functions in addition to reducing ocean waves as well as preventing coastal abrasion, besides that this mangrove forest functions as a natural laboratory for research and conservation land for various types of mangroves.','08.00 - 18.00','08.00 - 18.00',-8.7215837,115.1931176,10000,200000,0,23,12,48,100,152,335,4,'https://www.google.com/maps/place/Mangrove+Forest+Suwung+Kawuh/@-8.7215837,115.1931176,14z/data=!4m8!1m2!2m1!1sMangrove+Forest+Suwung+Kawuh!3m4!1s0x2dd241afffffffff:0xb52c300e5f23635e!8m2!3d-8.7215837!4d115.1931176'),
	(80,'New Kuta Green Park',0,1,1,0,0,'https://www.balitoursclub.net/wp-content/uploads/2017/03/New-Kuta-Green-Park.jpg','Badung Regency','The park is known for its various water slides, pools, and other water features. Visitors can enjoy thrilling rides down the slides, relax in the pools, or simply soak up the sun on the surrounding deck areas. Some of the popular attractions at New Kuta Green Park include the Lazy River, Wave Pool, and several slides catering to different levels of excitement.','10.00 - 18.00','10.00 - 18.00',-8.797723,115.12439,30000,35000,1,47,28,49,62,139,325,3.7,'https://www.google.com/maps/place/New+Kuta+Green+Park/@-8.797723,115.12438999999999,14z/data=!4m8!1m2!2m1!1sNew+Kuta+Green+Park!3m4!1s0x2dd24516053aaaa9:0xb38e366457ba6f6!8m2!3d-8.797723!4d115.12438999999999'),
	(81,'Dune Atlantis Bali',0,1,1,1,0,'https://lh3.googleusercontent.com/p/AF1QipPafwUmDbGxPw9bUCKoFGxy0Xo0Cnr4Ehr1WDJP=s1600-w1000','Denpasar City','Dune Atlantis Bali is a PADI 5 Star certified instructor development center/IDC (Instructor Development Center) dive center in Bali.','07.30 - 18.30','07.30 - 18.30',-8.704623,115.2570638,1179600,2795891,1,7,1,4,23,279,314,4.8,'https://www.google.com/maps/place/Dune+Atlantis+Bali/@-8.704623,115.2570638,14z/data=!4m8!1m2!2m1!1sDune+Atlantis+Bali!3m4!1s0x2dd2404a14d0785d:0x9bcd2ab924adb4ed!8m2!3d-8.704623!4d115.2570638'),
	(82,'Tebing Pantai Balangan',0,1,1,0,0,'https://www.nativeindonesia.com/foto/pantai-balangan/Pantai-Balangan-768x1365.jpg','Badung Regency','Tebing Pantai Balangan, also known as Balangan Cliff, is a scenic cliff located in the Balangan Beach area of Bali, Indonesia. It offers breathtaking views of the Indian Ocean and is a popular spot for photography, especially during sunset.','00.00 - 24.00','00.00 - 24.00',-8.7896794,115.1251549,0,0,1,0,3,10,52,246,311,4.7,'https://www.google.com/maps/place/Tebing+Pantai+Balangan/@-8.789679399999999,115.1251549,14z/data=!4m8!1m2!2m1!1sTebing+Pantai+Balangan!3m4!1s0x2dd24511961c7797:0xd2a9ae576286d!8m2!3d-8.789679399999999!4d115.1251549'),
	(83,'Priority Stand Up Paddle (SUP) Bali',0,1,1,0,0,'https://ik.imagekit.io/tvlk/xpe-asset/AyJ40ZAo1DOyPyKLZ9c3RGQHTP2oT4ZXW+QmPVVkFQiXFSv42UaHGzSmaSzQ8DO5QIbWPZuF+VkYVRk6gh-Vg4ECbfuQRQ4pHjWJ5Rmbtkk=/7830255304434/Priority-Stand-Up-Paddle-Bali-62fd1c15-0403-44a9-974d-b5062ca096f4.jpeg?_src=imagekit&tr=c-at_max,h-720,q-60,w-1280','Badung Regency','Priority Stand Up Paddle is a great activity and also an excellent way for all ages to stay active and connected with nature. People from all walks of life enjoy the versatility of standup paddle boarding – it’s affordable, low-impact, fun, and very easy to pick up.','07.00 - 22.00','07.00 - 22.00',-8.7551318,115.166382,6703,7266755,1,3,0,0,5,241,249,4.9,'https://www.google.com/maps/place/Priority+Stand+Up+Paddle+%28SUP%29+Bali/@-8.7551318,115.166382,14z/data=!4m8!1m2!2m1!1sPriority+Stand+Up+Paddle+%28SUP%29+Bali!3m4!1s0x2dd2443fb4b385c9:0xbe7d6e55ff12023e!8m2!3d-8.7551318!4d115.166382'),
	(84,'My Daily Blog',0,0,0,1,1,'https://lh3.googleusercontent.com/p/AF1QipN_A8jkclklN-Ws9ae7kSRWyw0wIFoLI-whXrsH=w768-h432-p-no-v0','Denpasar City','A restaurant in Bali that offers typical Balinese food that is packaged like a cafe and contemporary, Indonesian flavors which are a family culinary destination','09.00 - 17.00','09.00 - 17.00',-8.6834989,115.2254571,0,0,1,14,5,37,52,140,248,4.2,'https://www.google.com/maps/place/My+Daily+Blog/@-8.6834989,115.2254571,14z/data=!4m8!1m2!2m1!1sMy+Daily+Blog!3m4!1s0x2dd2405d8d31d6ad:0x1dedf8bd70780171!8m2!3d-8.6834989!4d115.2254571'),
	(85,'Bali Sea Turtle Society',0,1,1,0,0,'https://dynamic-media-cdn.tripadvisor.com/media/photo-o/17/ed/49/36/bali-sea-turtle-society.jpg?w=700&h=300&s=1','Badung Regency','The Bali Sea Turtle Society (BSTS) is a non-profit organization dedicated to the conservation and protection of sea turtles in Bali, Indonesia. The organization works towards raising awareness about the importance of sea turtle conservation, conducting research, and implementing conservation initiatives to safeguard sea turtle populations and their habitats.','08.00 - 18.00','08.00 - 18.00',-8.7232678,115.1698051,0,0,1,13,4,17,34,174,242,4.5,'https://www.google.com/maps/place/Bali+Sea+Turtle+Society/@-8.7232678,115.16980509999999,14z/data=!4m8!1m2!2m1!1sBali+Sea+Turtle+Society!3m4!1s0x2dd246bcc72fc287:0xe9eb9a52e1958aab!8m2!3d-8.7232678!4d115.16980509999999'),
	(86,'Pura Goa Gong',1,0,0,0,0,'https://www.balitoursclub.net/wp-content/uploads/2018/11/Ruangan-Gua-di-Pura-Goa-Gong.jpg','Badung Regency','Pura Goa Gong, also known as Goa Gong Temple, is a Hindu temple located in the village of Nusa Penida, Bali, Indonesia. It is situated within a limestone cave, known as Goa Gong, which gives the temple its name. The temple is known for its unique architecture and spiritual significance.','00.00 - 24.00','00.00 - 24.00',-8.8061773,115.176391,0,0,1,7,4,10,28,189,238,4.6,'https://www.google.com/maps/place/Pura+Goa+Gong/@-8.8061773,115.176391,14z/data=!4m8!1m2!2m1!1sPura+Goa+Gong!3m4!1s0x2dd244b0233ec75f:0xbfa6577565dd82ef!8m2!3d-8.8061773!4d115.176391'),
	(87,'Gunung Payung Beach',0,1,1,0,0,'https://wisatamilenial.com/wp-content/uploads/2022/02/Berfoto-di-Pantai-Gunung-Payung-Bali-Image-From-@adityagede99-768x960.jpg','Badung Regency','Gunung Payung Beach, also known as Pantai Gunung Payung, is a stunning hidden gem located on the southern coast of Bali, Indonesia. It is situated near the village of Kutuh in the Badung Regency. Gunung Payung Beach offers a tranquil and secluded atmosphere, making it a favorite destination for those seeking a peaceful and less crowded beach experience.','00.00 - 24.00','00.00 - 24.00',-8.8407765,115.1998363,4000,25000,1,2,3,8,26,196,235,4.7,'https://www.google.com/maps/place/Gunung+Payung+Beach/@-8.8407765,115.1998363,14z/data=!4m8!1m2!2m1!1sGunung+Payung+Beach!3m4!1s0x2dd25dd8c849c51d:0xbd06d97c64fc27b6!8m2!3d-8.8407765!4d115.1998363'),
	(88,'Pantai Padang Galak',0,1,1,0,0,'https://www.tempatwisata.pro/users_media/3150/Pantai%20Padang%20Galak.jpg','Denpasar City','Padang Galak Beach is known for its wide shoreline, dark volcanic sand, and calm waters. It is a favorite spot for locals and visitors who enjoy leisurely walks along the beach, taking in the beautiful ocean views and enjoying the cool sea breeze. The beach is also popular for kite flying, as the open and breezy conditions make it an ideal spot for this activity.','00.00 - 24.00','00.00 - 24.00',-8.6611382,115.2633006,5000,5000,1,6,2,5,43,174,230,4.6,'https://www.google.com/maps/place/Pantai+Padang+Galak/@-8.6611382,115.2633006,14z/data=!4m8!1m2!2m1!1sPantai+Padang+Galak!3m4!1s0x2dd241f0c7d5da97:0x1a904422c0294eea!8m2!3d-8.6611382!4d115.2633006'),
	(89,'Pura Dalem Pengembak',1,1,1,0,0,'https://dynamic-media-cdn.tripadvisor.com/media/photo-o/0b/d4/4e/3a/pura-dalem-pengembak.jpg?w=700&h=300&s=1','Denpasar City','Pura Dalem Pengembak, also known as Pengembak Temple, is a Balinese Hindu temple located in the village of Pengembak, Sanur, Bali, Indonesia. It is situated on the southeastern coast of Bali, overlooking the Indian Ocean. Pura Dalem Pengembak holds significant religious and cultural importance for the local community.','00.00 - 23.59','00.00 - 23.59',-8.7112326,115.2449744,0,0,1,3,1,7,25,190,226,4.8,'https://www.google.com/maps/place/Pura+Dalem+Pengembak/@-8.711232599999999,115.24497439999999,14z/data=!4m8!1m2!2m1!1sPura+Dalem+Pengembak!3m4!1s0x2dd2404de0f30675:0xfd6bcfddde5b4c5d!8m2!3d-8.711232599999999!4d115.24497439999999'),
	(90,'Pura Ulun Siwi Kayangan Jagat',1,0,0,0,1,'https://dynamic-media-cdn.tripadvisor.com/media/photo-o/09/21/c4/2f/pura-ulun-siwi.jpg?w=700&h=-1&s=1','Badung Regency','Ulun Suwi Temple, located in Banjar Mendega, the traditional village of Jimbaran, this temple was founded by Mpu Kuturan in the 11th century, a place of worship for the Gods and Goddesses.','00.00 - 23.59','00.00 - 23.59',-8.7704455,115.1731166,0,0,1,7,2,13,26,172,220,4.6,'https://www.google.com/maps/place/Pura+Ulun+Siwi+Kayangan+Jagat/@-8.7704455,115.1731166,14z/data=!4m8!1m2!2m1!1sPura+Ulun+Siwi+Kayangan+Jagat!3m4!1s0x2dd2446396c4befb:0xf8b10d9c443c003a!8m2!3d-8.7704455!4d115.1731166'),
	(91,'Hatten Wines Bali',0,1,0,1,1,'https://pr0.nicelocal.id/aYuPxw78UnaJ9Pjs5aWcYw/1125x1500,q85/4px-BW84_n0QJGVPszge3NRBsKw-2VcOifrJIjPYFYkOtaCZxxXQ2RFs10WXSF2QGd2M4FLmQslemSxcTDc1PaeMFJ2mIxMm_wK-FWBiJMLagWiUVnYlWA','Denpasar City','Hatten Wines Bali is a well-known winery located in Bali, Indonesia. It is renowned for producing quality wines using local grapes, particularly the indigenous grape variety called "Alphonse Lavallée." Hatten Wines has played a significant role in establishing Bali as a wine-producing region in Indonesia.','09.00 - 20.00','09.00 - 20.00',-8.7046808,115.2514838,0,0,1,3,2,6,35,171,217,4.7,'https://www.google.com/maps/place/Hatten+Wines+Bali/@-8.7046808,115.25148379999999,14z/data=!4m8!1m2!2m1!1sHatten+Wines+Bali!3m4!1s0x2dd241bc5fceb4bf:0xb99720972b91d814!8m2!3d-8.7046808!4d115.25148379999999'),
