	(95,'Gereja Katolik Santo Paulus Kulibul',1,0,0,0,0,'https://rumahibadah.kemenagbali.com//assets/img/301.jpeg','Badung Regency','The church is dedicated to St. Paul the Apostle and serves as a place of worship and spiritual gathering for the Catholic community in the area. It is part of the Catholic Archdiocese of Denpasar, which oversees the Catholic churches and communities in Bali.','07.00 - 19.00','07.00 - 19.00',-8.6358825,115.1585584,0,0,1,4,1,8,23,141,177,4.7,'https://www.google.com/maps/place/Gereja+Katolik+Santo+Paulus+Kulibul/@-8.6358825,115.15855839999999,14z/data=!4m8!1m2!2m1!1sGereja+Katolik+Santo+Paulus+Kulibul!3m4!1s0x2dd23892dd78f287:0x13f897d9efbf5749!8m2!3d-8.6358825!4d115.15855839999999'),
	(96,'Puri Agung Pemecutan, Badung Palace',1,0,0,0,0,'https://www.denpasarkota.go.id/public/uploads/wisata/datang_203004110442_PuriAgungPemecutan.jpg','Denpasar City','Puri Agung Pemecutan features traditional Balinese architecture and design, reflecting the rich cultural heritage of Bali. The palace complex consists of various structures, including the main palace building, courtyards, pavilions, and ceremonial areas. Intricate carvings, vibrant colors, and traditional Balinese artwork adorn the architecture, showcasing the artistic prowess of Balinese artisans.','00.00 - 24.00','00.00 - 24.00',-8.658175,115.2103,0,0,1,6,1,6,12,137,162,4.7,'https://www.google.com/maps/place/Puri+Agung+Pemecutan%2C+Badung+Palace/@-8.658175,115.21029999999999,14z/data=!4m8!1m2!2m1!1sPuri+Agung+Pemecutan%2C+Badung+Palace!3m4!1s0x2dd240a2f9b9d105:0x9b7d2621d3d95ea2!8m2!3d-8.658175!4d115.21029999999999'),
	(97,'Kemenuh Butterfly Park, Bali',0,1,1,0,0,'https://www.kabarwisatabali.com/wp-content/uploads/2021/06/taman-kupu-kupu-gianyar-bali-768x384.jpg.webp','Gianyar Regency','Kemenuh Butterfly Park is a butterfly sanctuary located in the village of Kemenuh, Gianyar regency, Bali, Indonesia. It is a popular tourist attraction that offers visitors the opportunity to explore the enchanting world of butterflies.','09.00 - 18.00','09.00 - 18.00',-8.572696,115.2866632,100000,100000,1,5,4,11,34,105,159,4.4,'https://www.google.com/maps/place/Kemenuh+Butterfly+Park%2C+Bali/@-8.572695999999999,115.28666319999999,14z/data=!4m8!1m2!2m1!1sKemenuh+Butterfly+Park%2C+Bali!3m4!1s0x2dd21735c9c428f3:0xe5e9c6a219b036bf!8m2!3d-8.572695999999999!4d115.28666319999999'),
	(98,'Sunset Beach Tanah Lot',0,1,1,0,0,'https://www.rentalmobilbali.net/wp-content/uploads/2019/12/Sunset-Pura-Tanah-Lot-Bali-768x432.jpg','Tabanan Regency','The beach offers stunning views of the Indian Ocean and is particularly known for its beautiful sunsets. Visitors flock to Sunset Beach Tanah Lot in the late afternoon to witness the breathtaking sunset scenery. The orange and golden hues of the setting sun create a picturesque backdrop against the temple and the crashing waves.','10.00 - 18.00','10.00 - 18.00',-8.6211034,115.0874603,0,0,1,2,0,2,26,124,154,4.8,'https://www.google.com/maps/place/Sunset+Beach+Tanah+Lot/@-8.621103399999999,115.08746029999999,14z/data=!4m8!1m2!2m1!1sSunset+Beach+Tanah+Lot!3m4!1s0x2dd239d50cd8ecb5:0xa822c989e6ff21fb!8m2!3d-8.621103399999999!4d115.08746029999999'),
