	(100,'YOUTH PARK',0,1,1,0,0,'http://news.propanraya.com/upload/2018_april/Youth_Park_1.jpg','Denpasar City','Carrying the theme "Denpasar, Youth and Culture", the mural design that will be drawn here has a collaboration concept in which the requirements for art and culture as well as the positive activities of "modern-day" youth. It was the Anonymous Architect (ATN), a community of architects in Bali, who initiated the mural painting event at the Youth Park.','00.00 - 24.00','00.00 - 24.00',-8.6362559,115.2133428,0,0,1,5,2,11,29,91,138,4.4,'https://www.google.com/maps/place/YOUTH+PARK/@-8.6362559,115.21334279999999,14z/data=!4m8!1m2!2m1!1sYOUTH+PARK!3m4!1s0x2dd23f69e7f938cd:0xcc5ef438805c8f68!8m2!3d-8.6362559!4d115.21334279999999'),
