	(102,'Puri Agung Denpasar',1,0,0,0,0,'https://cloud.jpnn.com/photo/bali/news/normal/2023/02/19/suasana-di-rumah-duka-raja-denpasar-ix-ida-cokorda-ngurah-ja-clp7.jpg','Denpasar City','Puri Agung Denpasar, also known as Denpasar Royal Palace, is the official residence of the royal family of Denpasar, the capital city of Bali, Indonesia. It holds historical and cultural significance as it represents the traditional Balinese architecture and serves as a center for various cultural and ceremonial activities.','08.00 - 17.00','08.00 - 17.00',-8.6510099,115.2174823,0,0,1,3,1,9,15,101,129,4.6,'https://www.google.com/maps/place/Puri+Agung+Denpasar/@-8.6510099,115.2174823,14z/data=!4m8!1m2!2m1!1sPuri+Agung+Denpasar!3m4!1s0x2dd2409e13356f89:0xb5812c38830fbd98!8m2!3d-8.6510099!4d115.2174823'),
